import React from 'react';
import {
Nav,
NavLink,
Bars,
NavMenu,
NavBtn,
NavBtnLink,
} from './NavbarElements';

const Navbar = () => {
return (
	<>
	<Nav>
		<NavMenu>
		<NavLink to='/cartoonify' activeStyle>
			Cartoonify
		</NavLink>
		<NavLink to='/bgremover' activeStyle>
			Background Remover
		</NavLink>
		</NavMenu>
	</Nav>
	</>
);
};

export default Navbar;
